import React, { useState } from "react";
import logo from "../assets/logo2.png"; // <-- Replace with your logo path

function Navbar() {
  const [open, setOpen] = useState(false);

  return (
   <nav className="fixed top-0 left-0 w-full z-[1000] backdrop-blur-md px-20 py-2 flex justify-between items-center
                lg:px-10 md:px-6">
  
  <img
    src="/logo.png"
    className="h-[70px] object-contain drop-shadow-[0_0_15px_#ff7300] hover:scale-105 transition"
  />

  <div className="hidden md:flex gap-7 items-center">
    <a className="text-accentLight hover:text-accent transition">Home</a>
    <a className="text-accentLight hover:text-accent transition">Skills</a>
    <a className="text-accentLight hover:text-accent transition">Services</a>
  </div>

  {/* Hamburger */}
  <div className="md:hidden flex flex-col gap-1 cursor-pointer z-[1100]">
    <span className="w-6 h-[3px] bg-accent"></span>
    <span className="w-6 h-[3px] bg-accent"></span>
    <span className="w-6 h-[3px] bg-accent"></span>
  </div>
</nav>

  );
}

export default Navbar;
